import { useState, useEffect } from "react";
import { Box, Stack, Typography } from "@mui/material";
import {SideBarComp, VediosComp} from "./";
import { fetchFromAPI } from "../utils/fetchFromAPI";

const FeedComp = () => {

  useEffect(() => {
    fetchFromAPI(`search?part=snipet&q=${selectedCategory}`)
  }, []);

  return (
    <Stack
      sx={{
        flexDirection: { sx: 'column', md: 'row' }
      }}
    >
      <Box sx={{
        height: { sx: 'auto', md: '92vh' },
        borderRight: '1px sold #3d3d3d',
        px: { sx: 0, md: 2 }
      }}>
        <SideBarComp />

        <Typography 
          className="Copyright"
          variant="body2"
          sx={{
            mt: 1.5,
            color: '#fff'
          }}
        >
          Copyright 2023 Samit08
        </Typography>

      </Box>

      <Box
        p={2}
        sx={{
          overflow: 'auto',
          height: '90vh',
          flex: 2
        }}
      >
        <Typography
          variant="h4"
          fontWeight="bold"
          sx={{ color: 'white' }}
        >
          New <span style={{ color: '#f31503' }}>vedios</span>
        </Typography>
        <VediosComp vedios={[]} />
      </Box>
    </Stack>
  )
}

export default FeedComp
